import './ToDo.css'
import bin from '../assets/bin.png'

const ToDo = ({ notes, done, deleteNote }) => {


    const getStyle = () => {
        return {
            textDecoration: notes.completed ? 'line-through' : 'none'
        }
    }


    return (
        <div style={getStyle()} className='conteiner-list'>
            <div id='conteiner-check'>
                <input type='checkbox' checked={notes.completed} onChange={() => done(notes.id)} />
            </div>
            {notes.task}

            <div id='conteiner-btn'>
                <button className='btn-delete' onClick={() => deleteNote(notes.id)}><img src={textCafe} alt="Logo Cafe de Altura"/></button>
            </div>
        </div>
    )
}


export default ToDo
